import request from '@/utils/request'; //零件成本精算参照报价查询

export function queryRecords(query) {
  return request({
    url: "/business/quotation/page",
    method: 'get',
    params: query
  });
} //零件成本精算查询

export function queryRecordsMain(query) {
  return request({
    url: "/business/quote-actuarial",
    method: 'get',
    params: query
  });
} // 零件成本精算新增

export function createRecords(data) {
  return request({
    url: "/business/quote-actuarial",
    method: 'post',
    data: data
  });
} // 零件成本精算编辑

export function updateRecords(rowId, data) {
  return request({
    url: "/business/quote-actuarial/".concat(rowId),
    method: 'patch',
    data: data
  });
} // 零件成本精算发布

export function effectRecords(data) {
  return request({
    url: "/business/quote-actuarial/oper",
    method: 'patch',
    data: data
  });
} //零件成本精算删除

export function deleteRecord(rowId) {
  return request({
    url: "/business/quote-actuarial/".concat(rowId),
    method: 'delete'
  });
}
